import ReactDOM from 'react-dom'
import React from 'react'

function Welcome(props) {
    return <h1>Hello, {props.name}</h1>;
}

function ManyWelcomes(props) {
    return (
        <div>
            <Welcome name={props.name1} />
            <Welcome name2={props.name2} />
        </div>
    );
}

ReactDOM.render(
    <ManyWelcomes name1="fsf" name2="jfdmfd"/>,
    document.getElementById('root')
)
